import MenuTopo from "./componentes/MenuTopo";
import SelecionarJogo from "./componentes/SelecionarJogo";

function App() {

  const Jogos = [
    'jogo 1',
    'jogo 2',
    'jogo 3'
  ]

  return (
    <div className="App">
      <MenuTopo/>
      <SelecionarJogo nome={Jogos}/>
    </div>
  );
}

export default App;
